import './App.css';
import React, { useEffect, useState } from 'react'
import axios from 'axios';
import oneStudent from './components/Student';

const StudentApp = () => {
  const [student, setStudent] = useState([]);

  //calling api
  useEffect(() => {
      axios.get('https://api.hatchways.io/assessment/students')
          .then(res => setStudent(res.data.students));
  }, [])

  return (
    <div >
      {student.map((student) => {return(<oneStudent/>) })}
    </div>
  );
}

export default StudentApp;
